        <div className="login">
            <h1 className="title">{signIn ? "Sign in":"Sign up"}</h1>
                {
                    SignIn ? (
                        <div className="inputs">
                            Username : <input className="text"/>
                        </div>
                    ) : (<h1>a</h1>)
                }
        </div>
    )
}

export default SignIn;
